    function createEnemy(origin, speed, startPos, zPos){
        //Create wooden blocks with texture
        var loader_truck = new THREE.TextureLoader();
        var path_truck ="data:image/jpeg;base64,"; 
        var enemy;
        loader_truck.load( path_truck,function(texture_truck)
        {

            texture_truck.wrapS = THREE.RepeatWrapping;
            texture_truck.wrapT = THREE.RepeatWrapping;
            texture_truck.repeat.set( 1, 1);

            enemy = new THREE.Mesh(
                new THREE.BoxGeometry (30, 20, 15),
                new THREE.MeshPhongMaterial({
                        ambient: Math.random() * 0xffffff, map:texture_truck
                    })
            );

            var tyre1 = new THREE.Mesh(new THREE.CylinderGeometry(4, 4, 26, 12, 12, false), new THREE.MeshBasicMaterial({color: 0x000000 }));
            tyre1.position.x = -7;
            tyre1.position.y = -10;
            tyre1.rotation.x = 90 * (Math.PI / 180);

            var tyre2 = new THREE.Mesh(new THREE.CylinderGeometry(4, 4, 26, 12, 12, false), new THREE.MeshBasicMaterial({color: 0x000000 }));
            tyre2.position.x = 7;
            tyre2.position.y = -10;
            tyre2.rotation.x = 90 * (Math.PI / 180);

            enemy.add(tyre1);
            enemy.add(tyre2);

            startPos = origin == 'right' ? startPos : -startPos;

            enemy.position.set(startPos, 18, zPos);

            enemy.userData = {
                origin: origin,
                speed: speed,
                startPos: startPos,
                zPos: zPos
            }

            enemy.name = 'enemy';
            enemy.castShadow = true;

            enemies.push(enemy);

            game.scene.add(enemy);
        });   
    } 

