    var collisionDetected=false;
    function checkForCollition() {
        //checkForDrowning();
        if(game.playerBox.position.z>-377)
        {
            //road
            if (enemies.length == 0) return;
            for (var i = 0; i < enemies.length; i++) {
              var eBox = new THREE.Box3().setFromObject(enemies[i]); 
              var pBox = new THREE.Box3().setFromObject(game.playerBox);   
              if(pBox.isIntersectionBox(eBox)){
               handleCollision();
              }
            }
        } 
        else if(game.playerBox.position.z<=-377 && game.playerBox.position.z>=-568 )
        {
            var alive = checkForDrowning();
            if(!alive){
                handleCollision();
            }
        }
    }

    function checkForDrowning(){
        var isAlive=false;
        if (friends.length == 0) return isAlive;
        for (var j = 0; j < friends.length; j++)
        {
            fBox = new THREE.Box3().setFromObject(friends[j]); 
            pBox = new THREE.Box3().setFromObject(game.playerBox);   
            if(pBox.isIntersectionBox(fBox)){
                isAlive=true;
                fBox=friends[j];
                pBox = game.playerBox;
                handleFloating(friends[j],game.playerBox);
            }
           
        }
        return isAlive;
    }
    function handleFloating(friend,player){
        //For friends
            if(friend.userData.origin == 'right')
                player.position.x -= friend.userData.speed;
            else
                player.position.x += friend.userData.speed;

            if ((friend.userData.origin == 'right' &&  player.position.x < -112) || (friend.userData.origin == 'left' &&  player.position.x > 112)) {
                //Player died
                handleCollision();
            }
            else {
                player.__dirtyPosition = true;
            }
    }
    function handleCollision() {
        //Remove life
        game.lives -= 1;
        document.getElementById("numberOfLives").innerHTML = game.lives;

        if (game.lives == 0) {
            document.getElementById("alertText").innerHTML = "" ;
            document.getElementById("alertText").innerHTML = "Game Over";
            document.getElementById("control-panel-alert").style.display = "block";
            setTimeout(function(){document.getElementById("control-panel-alert").style.display = "none";},2000);
            audio2.play();
            setTimeout(game.startNewGame, 2000);
        }

        game.playerActive = false;
        game.playerBox.children[0].material.ambient.setHex(0xff0000);
        if (game.lives != 0) {
            audio1.play(); 
            document.getElementById("alertText").innerHTML = "" ;
            document.getElementById("alertText").innerHTML = "You died. Be careful next time";
            document.getElementById("control-panel-alert").style.display = "block";
            setTimeout(function(){document.getElementById("control-panel-alert").style.display = "none";},2000);
        }
        
        handlePlayerKilled(); 
    }

    function handlePlayerKilled() {

        var playerBox = game.scene.getObjectByName('playerBox');
        game.scene.remove(playerBox);
        game.resetScene();
        player.createPlayer();
        game.playerActive = true;

    }
    
